import get from "lodash/get";
// import fs from 'fs';

const processArrayDiff = (before, after, config) => {
  const { itemIdentifer, diffKeyPaths } = config;

  const createIdToItemMap = item => [get(item, itemIdentifer), item];
  const beforeIdItemMap = new Map(before.map(createIdToItemMap));
  const afterIdItemMap = new Map(after.map(createIdToItemMap));

  const allIds = [...new Set([...beforeIdItemMap.keys(), ...afterIdItemMap.keys()])];
  return allIds.reduce(
    (acc, id) => {
      if (beforeIdItemMap.has(id) && !afterIdItemMap.has(id)) {
        acc.removed.push(beforeIdItemMap.get(id));
      } else if (!beforeIdItemMap.has(id) && afterIdItemMap.has(id)) {
        acc.added.push(afterIdItemMap.get(id));
      } else if (beforeIdItemMap.has(id) && afterIdItemMap.has(id)) {
        const changedValues = diffKeyPaths.filter(keyPath => get(beforeIdItemMap.get(id), keyPath) !== get(afterIdItemMap.get(id), keyPath));
        if (changedValues.length) {
          acc.changed.push({
            before: beforeIdItemMap.get(id),
            after: afterIdItemMap.get(id),
            changedValues
          });
        }
      }
      return acc;
    },
    {
      added: [],
      removed: [],
      changed: []
    }
  );
};

const processSingleDiff = (before, after, config) => {
  const { diffKeyPaths } = config;
  const hasValueAtPathChanged = keyPath => get(before, keyPath) !== get(after, keyPath);
  const changedValues = diffKeyPaths.filter(hasValueAtPathChanged);
  const returnValue = { changed: [] };
  if (changedValues.length) {
    returnValue.changed.push({ before, after, changedValues });
  }
  return returnValue;
};

// Returns Added, Removed and Changed fields
let getDiff = (beforeJSON, afterJSON, config) => {
  if (!beforeJSON || !afterJSON || !config) {
    throw new Error("Please provide all arguments");
  }

  const before = get(beforeJSON, config.pathToResult);
  const after = get(afterJSON, config.pathToResult);

  if (Array.isArray(before) && Array.isArray(after)) {
    //   fs.writeFileSync('result.json', JSON.stringify(processArrayDiff(before, after, config), 3));
    return processArrayDiff(before, after, config)
  } else {
    return processSingleDiff(before, after, config);
  }
};

